/* *** Manager ***
X - Deber tener una funcin para tokenizar un ticket. Esto significa crear un nuevo Ticket con los datos 
  correspondientes.
X - Deber tener una funcin para ver todos los tickets que contiene la plataforma, sin importar quien sea el 
  dueo.
X - Deber tener una funcin para ver los tickets que estn asignados a un dueo particular (address).
X - Deber tener una funcin para permitir la transferencia de un ticket segn su estado, es decir que si un 
  Ticket tiene un estado Transferible, puede cambiar de dueo. Permitiendo que el nuevo dueo enve ethers a 
  travs de la plataforma y que el dueo anterior reciba esos ethers.
X - Deber tener una funcin para permitir que el dueo de un ticket pueda cambiar el precio del mismo, pero en 
  ese caso el contrato Manager cobra un 5% de comisin y queda en su balance.
X - Deber tener una funcin para retornar la cantidad de tickets que tiene la plataforma y el precio total de 
  los tickets. Esto est pensado para mostrar estadsticas y poder llamar la atencin de futuros inversores.
X - Deber tener una funcin para eliminar el ticket de la lista. */

// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

import "./Ticket.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/** @title Contract Manager.*/
contract Manager is Ownable {
    // Mapping de Tickets
    mapping(address => Ticket[]) listTickets;

    // Owners Tickets
    address[] public OwnersTickets;

    // Total de Tickets
    uint256 totalTickets = 0;

    // Valor total de Tickets
    uint256 balanceTickets = 0;

    // Valor del Fee
    uint256 Fee = 5;

    // Address del Manager
    address addressManager;

    event FundsReceived(uint256 amount);

    receive() external payable {
        emit FundsReceived(msg.value);
    }

    fallback() external payable {
        emit FundsReceived(msg.value);
    }

    constructor() {
        addressManager = msg.sender;
    }

    /**@dev Funcion para Tokenizar Tickets.
    * @param _eventName Nombre del Evento.
    * @param _eventDescription Descripcin del Evento.
    * @param _eventType Tipo del Evento.
    * @param _price Precio del Ticket.
    * @param _transferStatus Estodo de Transferencia.
    * @param _owner Address Dueo del Ticket
    // El Ticket se crear con STATUS siempre en TicketStatus.VALID
    // Solo Manager puede crear un ticket nuevo
    */
    function createTicket(
        string memory _eventName,
        string memory _eventDescription,
        EventType _eventType,
        uint256 _price,
        TransferStatus _transferStatus,
        address _owner
    ) public payable onlyOwner {
        Ticket ticketNew = new Ticket(
            _eventName,
            _eventDescription,
            _eventType,
            _price,
            _transferStatus,
            _owner
        );
        listTickets[_owner].push(ticketNew);
        OwnersTickets.push(_owner);
        totalTickets += 1;
        balanceTickets = balanceTickets + _price;
    }

    /**@dev Funcion para cambiar el precio del ticket.
    * @param _addressOwner Address Dueo del Ticket Ingresado.
    * @param _index Index del Ticket Ingresado.
    * @param _newPriceTicket Nuevo Precio del Ticket Ingresado.
    // Controles realizados:
    // 1-Que listTickets[_addressOwner][_index].getOwner() sea msg.sender, solo el dueo puede cambiar el precio del Ticket,
    // 2-Que la _addressOwner ingresado sea realmente la duea del Ticket (getOwner())
    // 3-Que el monto a pagar sea mayor o igual al nuevo precio del ticket (newPriceTicket + commission para el Manager)
    */
    function changeTicketPrice(
        address _addressOwner,
        uint256 _index,
        uint256 _newPriceTicket
    ) public payable {
        // 1er Control
        require(
            listTickets[_addressOwner][_index].getOwner() == msg.sender,
            "No tiene permisos para esta accion"
        );
        // 2do Control
        require(
            listTickets[_addressOwner][_index].getOwner() == _addressOwner,
            "No coicide el address ingresado con su owner"
        );
        // 3er Control
        uint256 commission = (_newPriceTicket * Fee) / 100;
        require(
            msg.value >= _newPriceTicket + commission,
            "El monto de la transferencia es insuficiente"
        );
        // Pago de comisin y cambio del Precio
        feeManage(commission);
        uint256 priceDifference = _newPriceTicket -
            listTickets[_addressOwner][_index].getPrice();
        balanceTickets = balanceTickets + priceDifference;
        listTickets[_addressOwner][_index].changePrice(_newPriceTicket);
    }

    /**@dev Funcin para mostrar las estadisticas.
    * @return totalTickets Total de Tickets en la Plataforma.
    * @return balanceTickets Precio Total de Tickets en la Plataforma.
    */
    function showStatistics() public view returns (uint256, uint256) {
        return (totalTickets, balanceTickets);
    }

    /**@dev Funcion para Eliminar un Ticket segn address del Owner.
    * @param _addressOwner Address Dueo del Ticket.
    * @param _index Index del Ticket.
    // Solo Manager puede eliminar un ticket.
    */
    function deleteTicket(address _addressOwner, uint256 _index)
        public
        onlyOwner
    {
        listTickets[_addressOwner][_index] = listTickets[_addressOwner][
            _index + 1
        ];
        uint256 oldPrice = listTickets[_addressOwner][_index].getPrice();
        listTickets[_addressOwner].pop();
        totalTickets -= 1;
        balanceTickets = balanceTickets - oldPrice;
        OwnersTickets[_index] = OwnersTickets[_index + 1];
        OwnersTickets.pop;
    }

    /**@dev Funcin para cambiar el Estado de Transferencia (TRANSFERIBLE, NO_TRANSFERIBLE).
    * @param _addressOwner Address Dueo del Ticket.
    * @param _index Index del Ticket.
    // Control realizado:
    // -Que listTickets[_addressOwner][_index].getOwner() sea msg.sender, solo el dueo puede cambiar el TransferStatus
    */
    function changeTransferStatusTicket(address _addressOwner, uint256 _index)
        public
    {
        // Control
        require(
            listTickets[_addressOwner][_index].getOwner() == msg.sender,
            "No tiene permisos para esta accion"
        );
        // Cambia el estado
        listTickets[_addressOwner][_index].changeTransferStatus();
    }

    /**@dev Funcin para cambiar el Estado del Ticket (VALID, USED, EXPIRED).
    * @param _addressOwner Address Dueo del Ticket.
    * @param _index Index del Ticket.
    * @param _newTicketStatus Nuevo Estado del Ticket.
    // Control realizado:
    // Que listTickets[_addressOwner][_index].getOwner() sea msg.sender, solo el dueo puede cambiar el TicketStatus
    */
    function changeStatusTicket(
        address _addressOwner,
        uint256 _index,
        uint256 _newTicketStatus
    ) public {
        // Control
        require(
            listTickets[_addressOwner][_index].getOwner() == msg.sender,
            "No tiene permisos para esta accion"
        );
        // Cambia el estado
        listTickets[_addressOwner][_index].changeStatus(_newTicketStatus);
    }

    /**@dev Funcin para Transferir un Ticket.
    * @param _addressOwner Address Dueo del Ticket.
    * @param _index Index del Ticket.
    * @param _newOwner Nuevo Dueo del Ticket.
    // Controles Realizados:
    // 1-Que la _addressOwner sea realmente la duea del Ticket (getOwner())
    // 2-Que el Ticket sea Trasferible (tenga TransferStatus.TRANSFERIBLE),
    // 3-Que el Ticket sea Valido (tenga TicketStatus.VALID),
    // 4-Que _newOwner sea msg.sender (_newOwner address pagador del Ticket a _addressOwner),
    // 5-Que el monto a pagar sea mayor o igual al costo del ticket (getPrice()) + el feeTicket para el Manager
    */
    function transferTicket(
        address _addressOwner,
        uint256 _index,
        address _newOwner
    ) public payable {
        // 1er Control
        require(
            _addressOwner == listTickets[_addressOwner][_index].getOwner(),
            "Address reseptora del pago No es el Owner"
        );
        // 2do Control
        require(
            listTickets[_addressOwner][_index].getTransferStatus() ==
                TransferStatus.TRANSFERIBLE,
            "Este Ticket No es Transferible"
        );
        // 3er Control
        require(
            listTickets[_addressOwner][_index].getTicketStatus() ==
                TicketStatus.VALID,
            "Este Ticket No es Valido"
        );
        // 4to Control
        require(_newOwner == msg.sender, "No tiene permisos para esta accion");
        // 5to Control
        uint256 feeTicket = feeCalculation(_addressOwner, _index);
        require(
            msg.value >=
                listTickets[_addressOwner][_index].getPrice() + feeTicket,
            "Por favor, ingrese un valor"
        );
        // Pago del ticket y cambio de dueo
        (bool sent, ) = _addressOwner.call{
            value: msg.value - feeManage(feeTicket)
        }("");
        require(sent, "Error en el envio de Ether");
        listTickets[_addressOwner][_index].changeOwner(_newOwner);
    }

    /**@dev Muestra informacin de los Tickets segn dueo (owner).
    * @param _addressOwner Address Dueo de los Tickets.
    */
    function showTicketsByAddress(address _addressOwner) public {
        for (uint256 i = 0; i < listTickets[_addressOwner].length; i++) {
            listTickets[_addressOwner][i].showInformation();
        }
    }

    /**@dev Muestra informacion de todos los tickets en la Plataforma.
    */
    function showAllTickets() public {
        require(OwnersTickets.length > 0, "Lista de Tickets vacia");
        for (uint256 j = 0; j < OwnersTickets.length; j++) {
            showTicketsByAddress(OwnersTickets[j]);
        }
    }

    /**@dev Funcin para el pago de comisiones al contrato Manager.
    * @param _feeTicket Comisin (fee) a pagar al contrato Manager.
    */
    function feeManage(uint256 _feeTicket) public payable returns (uint256) {
        (bool success, ) = addressManager.call{value: _feeTicket}("");
        require(success == true, "Transferencia fallida!");
        return _feeTicket;
    }

    /**@dev Calculo del fee en las transferencias de ticket.
    * @param _addressOwner Address Dueo del Ticket.
    * @param _index Index del Ticket.
    */
    function feeCalculation(address _addressOwner, uint256 _index)
        public
        view
        returns (uint256)
    {
        return ((listTickets[_addressOwner][_index].getPrice() * Fee) / 100);
    }
}

